// import React from 'react';
// import RecommendedCourses from '../components/RecommendedCourses';

import React, { useState, useEffect } from 'react';
import { Bar, Pie } from 'react-chartjs-2';
import { CircularProgressbar } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';

const Dashboard = () => {
  const [recommendations, setRecommendations] = useState([]);
  const [progress, setProgress] = useState({});
  const [quizScores, setQuizScores] = useState([]);

  return (
    <div className="min-h-screen bg-gray-50 p-8">
      {/* Header Section */}
      <header className="mb-8">
        <h1 className="text-3xl font-bold text-gray-900">Welcome back, {studentName}!</h1>
        <p className="text-gray-600">Here's your learning progress</p>
      </header>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
        {/* Recommended Courses */}
        <div className="bg-white p-6 rounded-xl shadow-lg">
          <h2 className="text-xl font-semibold mb-4">Recommended for You</h2>
          <div className="space-y-4">
            {recommendations.map(course => (
              <div key={course.id} className="flex items-center p-3 bg-blue-50 rounded-lg">
                <div className="flex-1">
                  <h3 className="font-medium text-blue-900">{course.title}</h3>
                  <p className="text-sm text-blue-700">{course.match}% match</p>
                </div>
                <button className="px-4 py-2 bg-blue-600 text-white rounded-lg">
                  Start
                </button>
              </div>
            ))}
          </div>
        </div>

        {/* Progress Overview */}
        <div className="bg-white p-6 rounded-xl shadow-lg">
          <h2 className="text-xl font-semibold mb-4">Course Progress</h2>
          <div className="grid grid-cols-2 gap-4">
            {Object.entries(progress).map(([course, value]) => (
              <div key={course} className="text-center">
                <div className="w-24 h-24 mx-auto">
                  <CircularProgressbar 
                    value={value} 
                    text={`${value}%`}
                    styles={{
                      path: { stroke: '#3B82F6' },
                      text: { fill: '#1F2937', fontSize: '16px' }
                    }}
                  />
                </div>
                <p className="mt-2 text-sm text-gray-600">{course}</p>
              </div>
            ))}
          </div>
        </div>

        {/* Quiz Performance */}
        <div className="bg-white p-6 rounded-xl shadow-lg">
          <h2 className="text-xl font-semibold mb-4">Recent Quiz Scores</h2>
          <Bar
            data={{
              labels: quizScores.map(q => q.title),
              datasets: [{
                data: quizScores.map(q => q.score),
                backgroundColor: '#93C5FD'
              }]
            }}
            options={{
              scales: { y: { beginAtZero: true, max: 100 } }
            }}
          />
        </div>

        {/* Next Steps */}
        <div className="bg-white p-6 rounded-xl shadow-lg">
          <h2 className="text-xl font-semibold mb-4">Next Steps</h2>
          <ul className="space-y-4">
            <li className="flex items-center p-3 bg-green-50 rounded-lg">
              <span className="w-2 h-2 bg-green-400 rounded-full mr-3"></span>
              <div>
                <h4 className="font-medium text-green-900">Complete Python Basics Quiz</h4>
                <p className="text-sm text-green-700">Due in 2 days</p>
              </div>
            </li>
            {/* More next steps */}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
